INSERT INTO `settings` (`SettingsId`, `InstituteName`, `InstituteSlogan`, `InstituteEstablished`, `InstituteEIIN`, `InstituteIsMPO`, `InstituteLogo`, `InstituteHeader`, `InstitutePhone`, `InstituteEmail`, `InstituteAddress`, `InstituteWebsite`, `InstituteKeywords`, `InstituteTime`, `InstituteGoogleMaps`, `ShortInformation`, `AdminName`, `AdminPhone`, `AdminEmail`, `AdminPhoto`, `AdminSign`, `AdminMessage`, `AdminMessagePhoto`, `SelectedTheme`, `InstituteName_en`, `InstituteEIIN_en`, `InstituteAddress_en`) VALUES
(1, 'সাগরদিঘী কলেজ ', 'শিক্ষা জাতির মেরুদন্ড', '২০০৪ইং সন ২৩ জুলাই।', '১১৪১৯৬', '', 'Mono_++copy.png', '', '+৮৮০-১৭১৩ ৫৭৫৭৪৫', 'sagardighicollege@gmail.com', 'লোহানী সাগরদিঘী,ঘাটাইল,টাংগাইল।', 'http://www.institute.edu.bd', 'http://www.tritiyo.com', 'সকাল ০৯.০০টা থেকে বিকাল-০২.৩০টা।', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d3629.5725033535746!2d89.9839227!3d24.5348707!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sbd!4v1437993374527\" allowfullscreen></iframe>', 'সুজলা সুফলা শষ্য-শ্যামলা নদী মেঘনা আমাদের এই জন্মভূমির ৬৮ হাজার গ্রাম বাংলার একটি গ্রাম যা ঐতিহাসিক সাগরদিঘী নামে পরিচিত। যেখানে বাস করতেন তৎকালীন জমিদার ফতেদাদ খান গজনবী। এখানে রয়েছে রাধাকৃষ্ণের লীলাভূমি ও লীলা নিকেতনের স্মৃতি স্বরূপ তমাল গাছ। যেখানে হিন্দু সম্প্রদায় প্রতিবছর নাম কির্তন করেন। টাংগাইল জেলার অন্তর্গত ঘাটাইল উপজেলার পূর্ব সিমান্তে ঘাটাইল, মধুপুর, সখিপুর, ভালুকা ও ফুলবাড়ীয়া উপজেলা হতে পাকারাস্তার সংযোগ স্থলের উপকন্ঠে ২০০৪ইং সালে ২৩ সেপ্টেম্বর এই জনগুরুত্বপূর্ণ সাগরদিঘী নামক স্থানে পাহাড়ি অঞ্চলের সর্বস্তরের সহযোগিতায় শিক্ষার উন্নয়নের লক্ষ্যে সাগরদিঘী কলেজ নামে একটি উচ্চ শিক্ষা প্রতিষ্ঠান গড়ে তুলে।', 'মোহাম্মদ নাছির উদ্দিন-অধ্যক্ষ', '+৮৮০-১৭১৩ ৫৭৫৭৪৫', 'bolbolibegum123.gmail.com', '41.jpg', '41.jpg', 'শিক্ষার আলো মানুষের জ্ঞানের প্রসার, জীবন ও পৃথিবী সম্পর্কে নতুন চিন্তার উদ্ভাবন ঘটায়। আর শিক্ষা জাতির মেরুদন্ড হয়ে দাড়ায় তখনি, যখন একটি জাতি মানবীয় মূল্যবোধে উজ্জিবিত হয়ে শিক্ষা বান্ধব স্থিতিশীল সমাজ ও কার্যকর রাষ্ট্র প্রতিষ্ঠার মাধ্যমে উন্নত থেকে উন্নতর ভবিষ্যত নির্মাণে চেষ্ঠিত হয় আর এর জন্যই পয়োজন সুশিক্ষা। শিক্ষা আলোর সাথে তুল্য হলেও আলোর চেয়ে বিস্তারী। কারণ- আলো একমুখি আর শিক্ষার আলো বহুমুখি। সুশিক্ষার আলো আরো বহুবিস্তারী। এ জন্যই শিক্ষা মানুষের মেরুদন্ড এই বোধ ছাড়িয়ে গিয়ে জাতির মেরুদন্ড হিসেবে প্রকাশিত ও বিবেচিত হয়। এর মূলে রয়েছে সমষ্টি শিক্ষার এক মহত তাড়না। তাছাড়া শিক্ষা মৌলিক অধিকার হিসেবে স্কীকৃতি পাওয়ার নেপথ্যে রয়েছে মানব কল্যাণের সৎ ইচ্ছা। সেই ইচ্ছা থেকেই ঐতিহ্যবাহী সাগরদিঘীর প্রাণকেন্দ্রে গড়ে ওঠেছে সাগরদিঘী কলেজ। বলা যায় এই অঞ্চলের মানষের আশা-আকাঙ্খা, বোধ-বুদ্ধি ও সাংস্কৃতিক প্রেরণার অন্যতম নিদর্শন হিসেবে কলেজটি স্থাপিত। বাঙালী জাতীয় ঐক্যে যে শিক্ষা ভাবনা বহু বছরের আন্দোলনের মধ্য দিয়ে পরিষ্ফুটিত হয়েছে এ অঞ্চলের মানুষের মধ্যেও সেই প্রেরণা ও উদ্যোগ সহজেই খেয়ালযোগ্য। কলেজিটির বড় বৈশিষ্ট্য হচ্ছে প্রাকৃতিক সান্নিধ্যে শিক্ষা লাভের ব্যবস্থা। ভালো ও যুগোপযুগী শিক্ষার আলোয় আলোকিত হয়েই এখানের শিক্ষার্থীরা গড়ে উঠবে এই প্রতিশ্রুতি আমাদের শিক্ষকমন্ডলী ধারণ করেন। এ জন্য ছাত্র শিক্ষকের সৌহার্দ্যপূর্ণ সম্পর্কও বজায় রয়েছে ক্যাম্পাসটিতে। তা ছাড়াও ছাত্র-ছাত্রীদের জন্য কলেজ কর্তৃক নির্ধারিত পোষাক, নির্দিষ্ট সময়ে পাঠদান ও পরীক্ষা সম্পন্নকরণের জন্য নিজস্ব একাডেমিক ক্যালেন্ডার, সহপাঠ্যক্রমিক কার্যক্রম, কম্পিউটার ল্যাব, গ্রন্থাগার ব্যবহার বাধ্যতামূলক। সুশৃংঙ্খল, দেশপ্রেমিক যোগ্য নাগরিক হিসেবে গড়ে তোলার জন্য দক্ষ, অভিজ্ঞ ও প্রশিক্ষণপ্রাপ্ত শিক্ষকমন্ডলীর নিরলস প্রচেষ্টা, পাঠোন্নয়নে মনিটরিং, শিক্ষার্থীদের দাপ্তরিক কার্যক্রম সহজতর করণে কর্মচারীদের একাগ্রতা কলেজটির বিশেষ বৈশিষ্ট্য। শিক্ষার্থীদের মেধা ও মননের বিকাশে বিজ্ঞান ও দৃষ্টান্ত ভিত্তিক মানসম্মত শিক্ষাদান তথা ইন্টারনেট ব্যবহার নিশ্চিতকরণ এবং সংশ্লিষ্ট সকলের সহযোগীতায় ছাত্র ছাত্রীদের নিরাপত্তা বিধানে কলেজ কর্তৃপক্ষ দৃঢ় প্রতিজ্ঞ। অভিজ্ঞ ও যোগ্য গর্ভনিং বডির তত্ত্বাবধানে কলেজটির সার্বিক উন্নয়ন অব্যাহত রয়েছে। প্রগতিশীল শিক্ষা প্রতিষ্ঠান হিসেবে কলেজটির সুনাম রক্ষিত হোক এই কামনা করছি।\r\n                                          ', 'blankavatar.jpg', 'bluetheme', NULL, NULL, NULL);
